package com.hunliji.mvvm.activity.activity_main

import android.app.Application
import androidx.lifecycle.MutableLiveData
import com.hunliji.ext_master.deviceWidth
import com.hunliji.mvvm.BaseVm

/**
 * MainVm
 *
 * @author wm
 * @date 20-2-11
 */
class MainVm(app: Application, map: MutableMap<String, @JvmSuppressWildcards Any>) :
    BaseVm(app, map) {
    val title = MutableLiveData<String>()
    val imgUrl = MutableLiveData<String>()
    val imgErrorUrl = MutableLiveData<String>()
    val deviceWidthValue = MutableLiveData<Int>().also {
        it.value = deviceWidth
    }
    val height = MutableLiveData<Int>().also {
        it.value = deviceWidth / 4
    }
    val webpUrl = MutableLiveData<String>()
    val gifUrl = MutableLiveData<String>()
    val webpUrl2 = MutableLiveData<String>()
    init {
        gifUrl.value = "https://qnvideo.hunliji.com/seek-6aa5f19f4a45a48585d723378d404fe3-1576512248.gif"
        title.value = (map["id"] as? Int).toString()
        imgUrl.value =
            "https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1581658378627&di=f82ca08bbb43bf0b107041df20266f28&imgtype=0&src=http%3A%2F%2Fimg4.cache.netease.com%2Fphoto%2F0006%2F2011-11-03%2F7HV5QDOD17KK0006.jpg"
        imgErrorUrl.value = "abck"
        webpUrl.value = "https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1581920372622&di=46a5874288f3873654b9fe17b7f286cb&imgtype=0&src=http%3A%2F%2Fimg10.cache.hxsd.com%2Fgame%2F2016%2F08%2F30%2F693352_1472527498_3.jpg"
        webpUrl2.value = "data:image/jpeg;base64,"
    }
}


